package Javapractice;

public class FirstOne {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int i;
		int j=9;
		int k=5;
		for(i=0; i<=4;i++) {
			System.out.println(i);
		}
		while( j<=12) {
			System.out.println(j);
			j++;
		}
		do{
		System.out.println(k);	
		k++;
		}
		while(k<=8);

	}

}
